mutation SignUp($username: String!, $password: String!, $question: String!, $answer: String!) {
  signUp(
    input: {username: $username, password: $password, question: $question, answer: $answer}
  ) {
    userId
    tokens {
      access_token
      refresh_token
    }
  }
}
